-- Precautionary, incase the database already exists
DROP DATABASE IF EXISTS Firebird;

-- Creating the Firebird database
CREATE DATABASE IF NOT EXISTS Firebird;

-- Use the created database Firebird
USE Firebird;

-- Creating the Promotion table
CREATE TABLE `Promotion` (
  `prm_id` char(10),
  `promotion_type` varchar(255),
  `promotion_msg` varchar(255),
  PRIMARY KEY (`prm_id`)
);

-- Creating the PromotionCode table
CREATE TABLE `PromotionCode` (
  `pmc_id` char(10),
  `promotion_type` varchar(255),
  `prm_code` varchar(255),
  `prm_code_msg` varchar(255),
  PRIMARY KEY (`pmc_id`)
 # FOREIGN KEY (`promotion_type`) REFERENCES `Promotion`(`promotion_type`)
);

-- Creating the Product table
CREATE TABLE `Product` (
  `prod_id` int(32),
  `SKU` varchar(255),
  `Product_Name` varchar(255),
  `Product_Color_Count` int(32),
  `Product_Size_Count` int(32),
  `cat_id` char(8),
  PRIMARY KEY (`prod_id`)
);

-- Creating the Category table
CREATE TABLE `Category` (
  `cat_id` char(8),
  `Category` varchar(255),
  PRIMARY KEY (`cat_id`)
);

-- Creating the Users table
CREATE TABLE `Users` (
  `usr_id` char(10),
  `first_name` varchar(255),
  `family_name` varchar(255),
  `email` varchar(255),
  `phone` varchar(255),
  `address` varchar(255),
  `rec_product` int(32),
  `rec_category` char(8),
  `prm_number` int(32),
  `rec_promotion` char(10),
  PRIMARY KEY (`usr_id`),
  FOREIGN KEY (`rec_category`) REFERENCES `Category`(`cat_id`),
  FOREIGN KEY (`rec_promotion`) REFERENCES `Promotion`(`prm_id`),
  FOREIGN KEY (`rec_product`) REFERENCES `Product`(`prod_id`)
);

