CREATE TABLE CombinedData (
    usr_id CHAR(10),
    first_name VARCHAR(255),
    family_name VARCHAR(255),
    email VARCHAR(255),
    phone VARCHAR(255),
    address VARCHAR(255),
    rec_product INT,
    rec_category CHAR(8),
    prm_number INT,
    rec_promotion CHAR(10),
    promotion_type VARCHAR(255),
    promotion_msg VARCHAR(255),
    prm_code VARCHAR(255),
    Product_Name VARCHAR(255),
    Category_Name VARCHAR(255),
    prm_code_msg varchar(255)
);


    usr_id, first_name, family_name, email, phone, address,
    rec_product, rec_category, prm_number, rec_promotion,
    promotion_type, promotion_msg, prm_code,prm_code_msg, Product_Name, Category_Name
)
SELECT
    u.usr_id, u.first_name, u.family_name, u.email, u.phone, u.address,
    u.rec_product, u.rec_category, u.prm_number, u.rec_promotion,
    prm.promotion_type, prm.promotion_msg, pc.prm_code, pc.prm_code_msg,
    pr.Product_Name, c.Category
FROM
    Users AS u
LEFT JOIN
    Promotion  prm ON u.rec_promotion = prm.prm_id
LEFT JOIN
    PromotionCode  pc ON prm.promotion_type = pc.promotion_type
LEFT JOIN
    Product  pr ON u.rec_product = pr.prod_id
LEFT JOIN
    Category  c ON u.rec_category = c.cat_id;
    

SELECT * FROM CombinedData